export default function LeafDecor() {
  const [rand, updateRand] = useState(0);

  useEffect(() => {
    updateRand(Math.floor(Math.random() * 10));
  }, []);
  useEffect(() => {
    gsap.registerPlugin(MotionPathPlugin, ScrollTrigger);
    leafPaths.forEach((path, idx) => {
      gsap.to(`#leaf${idx + 1}`, {
        duration: 3,
        ease: "power2.inOut",
        motionPath: {
          path: path,
          alignOrigin: [0.5, 0.5],
          autoRotate: true,
          start: 1,
          end: 0.06,
        },
        stagger: 3,
      });
      const tl = new gsap.timeline({
        scrollTrigger: {
          trigger: `.trigger`,
          start: "top center",
          scroller: "#scroller",
          end: "bottom center",
          scrub: true,
          markers: false,
        },
      });
      tl.to(`#leaf${idx + 1}`, {
        duration: 3,
        ease: "power1.inOut",
        motionPath: {
          path: path,
          alignOrigin: [0.5, 0.5],
          autoRotate: true,
          start: 0.5,
          end: 0.1,
        },
        stagger: 3,
      });
    });
  }, [leafPaths, rand]);

  return (
    <svg
      width="100vw"
      height="100vh"
      fill="none"
      className="absolute pointer-events-none top-0 z-[1] "
      xmlns="http://www.w3.org/2000/svg"
    >
      {rand % 2 === 0 ? <AutumnSet /> : <SummerSet />}
    </svg>
  );
}
